const [ignored, forceUpdate] = useReducer(x => x + 1, 0);

setTimeout(function () {
  forceUpdate();
},10000);
function  get(){
    lat=lat1;
    long=long1;
    console.log('lat='+lat+" long="+long);
    return 1;
  }

  function App () {
    if(get()){
      return (
        <Map
          markers={[
              { 
                  position: [ parseFloat(lat) , parseFloat(long)],
                  draggable: true, 
                  title:"I am here",
                  onClick: e => {
                      console.log("clicked ");
                  },
                  onDragend: e => {
                      console.log("dragged");
                  }
              }
          ]}
          />
     );
        }

      }


export default App;
